import React,{useState} from 'react';
import Card from '../UI/Card';
import classes from './AddUser.module.css'
import Button from '../UI/Button';



function AddUser(props) {

    const[enteredUsername , setEnteredUsername] = userState("")
    const[enteredAge , setEnteredAge] = userState("")

    function AddUsrhandler(event){
        event.preventDefault();
        console.log(enteredAge , enteredUsername)
    }

    function usernameChangeHandler(event){
        setEnteredUsername(event.target.value)
    }

    function ageChangeHandler(event){
        setEnteredAge(event.target.value)
    }

    return(
        <Card className = {classes.input}>
        <form onSubmit={AddUsrhandler}>
            <label htmlFor='username' onChange={usernameChangeHandler}> UserName</label>
            <input type='text' id='username'/>
            <label htmlFor='age' onChange={ageChangeHandler}>Age(Years)</label>
            <input type='number' id='age'/>
            <Button type='submit'>Add User</Button>
        </form>
        </Card>
    )

}

export default AddUser;
